import classes from './DrinkSummary.module.css';

const DrinkSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Wonderful Coffee, Delivered To You</h2>
      <p>
        Choose your favorite coffee from our broad selection of available coffee
        and enjoy a delicious lunch or dinner at home.
      </p>
      <p>
        All our coffee are cooked with high-quality ingredients, just-in-time and
        of course by experienced baristas!
      </p>
    </section>
  );
};

export default DrinkSummary;
